"Al-Tirmidhi Hadith 4649: Narrated by Abdullah ibn Amr ibn al-'Asl;;

Allah's Messenger (saws) said, "He does not belong to us who imitates other people!”"


Muslims must stop copying hindu cultures. These are not Bengali culture.

